import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
//import App from './App';
import * as serviceWorker from './serviceWorker';

//ReactDOM.render(<App />, document.getElementById('root'));


class Test extends React.Component
{
    userName(name)
    {
        return(
            <h1><strong>{name}</strong></h1>
        );
    }

    userAge(age)
    {
        return(
            <div><strong>Age: </strong>{age}</div>
        );
    }

    userGender(gender)
    {
        return(
            <div><strong>Gender: </strong>{gender}</div>
        );
    }

    render()
    {
        return(
            <div>
                <div>{this.userName(this.props.name)}</div>
                <div>{this.userAge(this.props.age)}</div>
                <div>{this.userGender(this.props.gender)}</div>
            </div>
        );
    }
}


ReactDOM.render(<Test name="Abcd" age={20} gender="M" />,document.getElementById('root'));

serviceWorker.unregister();
